  return (
    <div className="table">
      <table>
        <caption className="table-name">Words List</caption>
        <thead>
          <tr>
            <th scope="col">Word</th>
            <th scope="col">Transcription</th>
            <th scope="col">Translation</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Ячейка 1</td>
            <td>Ячейка 2</td>
            <td>Ячейка 3</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}
export default WordList;
